('1D78EA90-808D-4FB7-9E90-9C9D745D05D2',4,2,'PercGrayArea','% Gray Area','{"$type":"Vanrise.Analytic.Entities.AnalyticMeasureConfig, Vanrise.Analytic.Entities","GetValueMethod":"var supplierIds = context.GetAllDimensionValues(\"Supplier\");\nvar customerIds = context.GetAllDimensionValues(\"Customer\");\nvar allAccountIds = new System.Collections.Generic.List<dynamic>(supplierIds);\nallAccountIds.AddRange(customerIds);\nvar nominalCapacity = (new TOne.WhS.BusinessEntity.Business.CarrierAccountManager()).GetAccountsTotalNominalCapacity(allAccountIds.Select(itm => (int)itm));\nint periodLengthInMinutes = (int)(context.GetAggregateValue(\"MaxLastCDRAttempt\") - context.GetAggregateValue(\"MinBatchStart\")).TotalMinutes;\n/*if(context.IsGroupingDimensionIncluded(\"DayHour\"))\n    periodLengthInMinutes = 60;\t\nelse if(context.IsGroupingDimensionIncluded(\"Day\"))\n    periodLengthInMinutes = 24 * 60;\nelse if(context.IsGroupingDimensionIncluded(\"YearWeek\"))\n    periodLengthInMinutes = 7 * 24 * 60;\nelse if(context.IsGroupingDimensionIncluded(\"Month\"))\n    periodLengthInMinutes = 30 * 24 * 60;\nelse periodLengthInMinutes = (int)(context.GetQueryToTime() - context.GetQueryFromTime()).TotalMinutes;*/\nvar durationInMinutes = context.GetAggregateValue(\"SumDurationInSeconds\") / 60;\nvar utilisationInMinutes = context.GetAggregateValue(\"SumUtilizationInSeconds\") / 60;\nvar period = nominalCapacity * periodLengthInMinutes * 30;\nreturn (Decimal)(period != 0 ? (utilisationInMinutes - durationInMinutes) * 100 / period : 0);","DependentAggregateNames":{"$type":"System.Collections.Generic.List`1[[System.String, mscorlib]], mscorlib","$values":["SumDurationInSeconds","SumUtilizationInSeconds","MaxLastCDRAttempt","MinBatchStart"]},"DependentDimensions":{"$type":"System.Collections.Generic.List`1[[System.String, mscorlib]], mscorlib","$values":["Supplier","Customer"]},"FieldType":{"$type":"Vanrise.GenericData.MainExtensions.DataRecordFields.FieldNumberType, Vanrise.GenericData.MainExtensions","DataType":0,"IsNullable":false,"ConfigId":2}}'),
